text:
The 988 LGBTQ+ crisis line saves lives — especially for LGBTQ+ youth, who are far more likely to experience suicidal thoughts.

@POTUS shutting it down is plain cruel.

I brought together a bipartisan group of leaders today to say: our young people deserve support, not silence. https://t.co/lnOuHQF0nT

Federal support for National Heritage Areas — like Quindaro and Brown v. Board — was approved months ago, but communities are still waiting.

These sites protect our history and boost tourism and local economies.

@RepCleaver and I urged @POTUS to get this support moving.
